#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int compare(const void *a, const void *b) {
    char **arrA = *(char ***)a;
    char **arrB = *(char ***)b;
    int cmp = strcmp(arrA[0], arrB[0]);
    if (cmp == 0) return strcmp(arrA[1], arrB[1]);
    return cmp;
}

char** findHighAccessEmployees(char*** access_times, int access_timesSize, int* access_timesColSize, int* returnSize) {
    qsort(access_times, access_timesSize, sizeof(char**), compare);

    char **result = (char**)malloc(access_timesSize * sizeof(char*));
    *returnSize = 0;
    for (int i = 0; i < access_timesSize; ) {
        int count = 1;
        int j = i + 1;
        while (j < access_timesSize && strcmp(access_times[i][0], access_times[j][0]) == 0) {
            int time1 = atoi(access_times[j - 1][1]);
            int time2 = atoi(access_times[j][1]);
            if (time2 - time1 < 100) {
                count++;
                if (count >= 3) {
                    result[*returnSize] = (char*)malloc(strlen(access_times[i][0]) + 1);
                    strcpy(result[*returnSize], access_times[i][0]);
                    (*returnSize)++;
                    break;
                }
            } else {
                count = 1;
            }
            j++;
        }
        while (i < access_timesSize && strcmp(access_times[i][0], access_times[j - 1][0]) == 0) {
            i++;
        }
    }
    return result;
}
